@determinatorx @ziontree @latikambourke @Bowenchris @RemindMe_OfThis I mean we have uranium and thorium, none of the nuclear tech is in principle that exotic at this point.

In contrast solar is totally reliant on china, so I can see why some people would rather us go hard into the nuclear stack.

I just want a viable fossil fuel alternative...

